import React, { Component } from "react";

class Header extends Component {
    Person = {
        name: "Marius",
        lastnam: "Grøndahl"
    }
    render() {
        const name = this.Person.name;
        return (
            <header>Hei <name /></header>
        );
    }

}

export default Header;
